import React from "react";
import AOS from "aos";
import "aos/dist/aos.css";
AOS.init();

function Home() {
  return (
    <div>
      <div data-aos="zoom-in-up">
        <h1> Hello this is Home Page</h1>
        <h2>
          My name is Ryo Saeba , I am <b>MERN </b>
          Stack Developer and A Japanese Interpreter
        </h2>
      </div>
    </div>
  );
}

export default Home;
